### CREATE DATABASE ###
#######################

DROP DATABASE GaaRSdb ;
CREATE DATABASE GaaRSdb ;
USE GaaRSdb ;

CREATE TABLE og_oids (
	og_id INT NOT NULL AUTO_INCREMENT,
	og_oid VARCHAR(255) UNIQUE NOT NULL,
	PRIMARY KEY (og_id)
);

CREATE TABLE species (
	species_id INT NOT NULL AUTO_INCREMENT,
	species_oid VARCHAR(255) UNIQUE NOT NULL,
	species_name VARCHAR(255) NOT NULL,
	PRIMARY KEY (species_id)
);

CREATE TABLE genes (
	gene_id INT NOT NULL AUTO_INCREMENT,
	gene_oid VARCHAR(255) UNIQUE NOT NULL,
	gene_name VARCHAR(255) NOT NULL,
	sequence VARCHAR(8000) NOT NULL,
    species_id INT NOT NULL,
    og_id INT NOT NULL,
	PRIMARY KEY (gene_id),
	FOREIGN KEY (species_id) REFERENCES species(species_id),
	FOREIGN KEY (og_id) REFERENCES og_oids(og_id)
) ;

